" 983 :   private void visitObjLitKey(NodeTraversal t, Node key, Node objlit) {
 984 :     // Do not validate object lit value types in externs. We don't really care,
 985 :     // and it makes it easier to generate externs.
 986 :     if (objlit.isFromExterns()) {
 987 :       ensureTyped(t, key);
 988 :       return;
 989 :     }
 990 : 
 991 :     // TODO(johnlenz): Validate get and set function declarations are valid
 992 :     // as is the functions can have "extraneous" bits.
 993 : 
 994 :     // For getter and setter property definitions the
 995 :     // r-value type != the property type.
 996 :     Node rvalue = key.getFirstChild();
 997 :     JSType rightType = NodeUtil.getObjectLitKeyTypeFromValueType(
 998 :         key, getJSType(rvalue));
 999 :     if (rightType == null) {
1000 :       rightType = getNativeType(UNKNOWN_TYPE);
1001 :     }
1002 : 
1003 :     Node owner = objlit;
1004 : 
1005 :     // Validate value is assignable to the key type.
1006 : 
1007 :     JSType keyType = getJSType(key);
1008 : 
1009 :     JSType allowedValueType = keyType;
1010 :     if (allowedValueType.isEnumElementType()) {
1011 :       allowedValueType =
1012 :           allowedValueType.toMaybeEnumElementType().getPrimitiveType();
1013 :     }
1014 : 
1015 :     boolean valid = validator.expectCanAssignToPropertyOf(t, key,
1016 :         rightType, allowedValueType,
1017 :         owner, NodeUtil.getObjectLitKeyName(key));
1018 :     if (valid) {
1019 :       ensureTyped(t, key, rightType);
1020 :     } else {
1021 :       ensureTyped(t, key);
1022 :     }
1023 : 
1024 :     // Validate that the key type is assignable to the object property type.
1025 :     // This is necessary as the objlit may have been cast to a non-literal
1026 :     // object type.
1027 :     // TODO(johnlenz): consider introducing a CAST node to the AST (or
1028 :     // perhaps a parentheses node).
1029 : 
1030 :     JSType objlitType = getJSType(objlit);
1031 :     ObjectType type = ObjectType.cast(
1032 :         objlitType.restrictByNotNullOrUndefined());
1033 :     if (type != null) {
1034 :       String property = NodeUtil.getObjectLitKeyName(key);
1035 :       if (type.hasProperty(property) &&
1036 :           !type.isPropertyTypeInferred(property) &&
1037 :           !propertyIsImplicitCast(type, property)) {
1038 :         validator.expectCanAssignToPropertyOf(
1039 :             t, key, keyType,
1040 :             type.getPropertyType(property), owner, property);
1041 :       }
1042 :       return;
1043 :     }
1044 :   }"

